  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Lower
  Klamath NWR outlines Refuge accomplishments during the 1981 calendar year. The report
  begins with a summary of the year's highlights and weather conditions. The report
  includes a planning section which discusses research and investigations. Refuge
  administration is outlined; information about safety and technical assistance is
  given. Habitat management is also covered; subjects include wetlands, croplands,
  grazing, haying, fire management, and pest control. The wildlife section of the
  report discusses endangered and threatened species, waterfowl, marsh birds and waterbirds,
  shorebirds, raptors, game mammals, animal control, and disease control. The public
  uses of the Refuge described in this report include outdoor classrooms, interpretive
  programs, hunting, trapping, wildlife observation, outdoor recreation, and law enforcement.
  The equipment and facilities section of the report provides information about new
  construction, rehabilitation, equipment replacement, and energy conservation.\",\n\t\"owner_org\":
